import { Icon, Menu } from "antd";
import styled from "styled-components";
import Link from "next/link";
const NavlinkWrapper = styled.div`
	color: white;
`;
const NavLinkMobile = styled.div`
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: initial;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: none;
	}
`;
const NavLinkDesktop = styled.div`
	@media screen and (max-width: ${props => props.theme.tablet}) {
		display: none;
	}
	@media screen and (min-width: ${props => props.theme.tablet}) {
		display: flex;
		flex-direction: column;
		color: white;
	}
`;
const Navlinks = () => (
	<NavlinkWrapper>
		<NavLinkMobile>
			<Link to="/">
				<Icon type="home" />
			</Link>
			<Link to="/about-me">
				<Icon type="user" />
			</Link>
		</NavLinkMobile>
		<NavLinkDesktop>
			<Link to="/">
				<Icon type="home" />
			</Link>
			<Link to="/about-me">
				<Icon type="user" />
			</Link>
		</NavLinkDesktop>
	</NavlinkWrapper>
);
export default Navlinks;
